import React, { useState } from "react";

const ResumeAnalysis = ({ requiredSkills }) => {
  const [file, setFile] = useState(null);
  const [analysis, setAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleFileUpload = async (e) => {
    const file = e.target.files[0];
    if (!file) return;

    // Check if file is PDF
    if (file.type !== "application/pdf") {
      setError("Please upload a PDF file");
      return;
    }

    setFile(file);
    setError(null);
    setLoading(true);

    const formData = new FormData();
    formData.append("resume", file);
    formData.append("required_skills", requiredSkills.join(","));

    try {
      const response = await fetch("http://localhost:5000/analyze-resume", {
        method: "POST",
        body: formData,
      });

      const data = await response.json();
      setAnalysis(data);
    } catch (err) {
      setError("Error analyzing resume. Please try again.");
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const getMatchPercentage = () => {
    if (!analysis?.matched_skills || !analysis?.required_skills) return 0;
    return Math.round(
      (analysis.matched_skills.length / analysis.required_skills.length) * 100
    );
  };

  return (
    <div className="bg-white rounded-lg shadow-lg p-6">
      <h2 className="text-2xl font-semibold text-gray-800 mb-4">
        Resume Analysis
      </h2>

      {/* Upload Section */}
      <div className="mb-6">
        <label className="block text-sm font-medium text-gray-700 mb-2">
          Upload your resume (PDF only)
        </label>
        <input
          type="file"
          accept=".pdf"
          onChange={handleFileUpload}
          className="block w-full text-sm text-gray-500
            file:mr-4 file:py-2 file:px-4
            file:rounded-full file:border-0
            file:text-sm file:font-semibold
            file:bg-indigo-50 file:text-indigo-700
            hover:file:bg-indigo-100"
        />
      </div>

      {/* Loading State */}
      {loading && (
        <div className="text-center py-4">
          <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-indigo-600 mx-auto"></div>
          <p className="mt-2 text-gray-600">Analyzing your resume...</p>
        </div>
      )}

      {/* Error Message */}
      {error && (
        <div className="bg-red-50 text-red-700 p-4 rounded-lg mb-4">
          {error}
        </div>
      )}

      {/* Analysis Results */}
      {analysis && (
        <div className="space-y-4">
          <div className="bg-indigo-50 p-4 rounded-lg">
            <h3 className="text-lg font-medium text-indigo-800 mb-2">
              Match Score
            </h3>
            <div className="flex items-center">
              <div className="text-3xl font-bold text-indigo-600">
                {getMatchPercentage()}%
              </div>
              <div className="ml-2 text-gray-600">
                match with required skills
              </div>
            </div>
          </div>

          {/* Matched Skills */}
          {analysis.matched_skills && analysis.matched_skills.length > 0 && (
            <div>
              <h3 className="text-lg font-medium text-gray-800 mb-2">
                Matched Skills
              </h3>
              <div className="flex flex-wrap gap-2">
                {analysis.matched_skills.map((skill, index) => (
                  <span
                    key={index}
                    className="bg-green-100 text-green-800 px-3 py-1 rounded-full text-sm"
                  >
                    {skill}
                  </span>
                ))}
              </div>
            </div>
          )}

          {/* Missing Skills */}
          {analysis.missing_skills && analysis.missing_skills.length > 0 && (
            <div>
              <h3 className="text-lg font-medium text-gray-800 mb-2">
                Skills to Add
              </h3>
              <div className="flex flex-wrap gap-2">
                {analysis.missing_skills.map((skill, index) => (
                  <span
                    key={index}
                    className="bg-yellow-100 text-yellow-800 px-3 py-1 rounded-full text-sm"
                  >
                    {skill}
                  </span>
                ))}
              </div>
            </div>
          )}

          {/* Recommendations */}
          {analysis.recommendations && analysis.recommendations.length > 0 && (
            <div className="bg-blue-50 p-4 rounded-lg">
              <h3 className="text-lg font-medium text-blue-800 mb-2">
                Recommendations
              </h3>
              <ul className="list-disc list-inside text-gray-700 space-y-2">
                {analysis.recommendations.map((rec, index) => (
                  <li key={index}>{rec}</li>
                ))}
              </ul>
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default ResumeAnalysis;
